import React from 'react';
import 'bootstrap/dist/css/bootstrap.css';
import { Col, Row, FormGroup, Label, Input, InputGroupText, InputGroupAddon } from 'reactstrap';

export default class BeneficiaryClient extends React.Component {
	constructor() {
		super();
		this.state = {
			idPsp: '',
			ok: false
		};
	}
	componentDidMount() {
		this.setState({ idPsp: Math.floor(Math.random() * Math.floor(10000000000)), ok: true });
		this.setState({ ok: false });
	}

	render() {
		if (this.state.ok) {
			this.props.handleClickIdPsp(this.state.idPsp);
		}
		return (
			<div>
				<Label style={{ color: 'grey' }}>NÂ° paiement</Label>
				<FormGroup>
					<Input
						type="text"
						name="PaiementNumber"
						id="PaiementNumber"
						maxLength="10"
						required
						value={this.state.idPsp}
						onChange
					/>
				</FormGroup>
			</div>
		);
	}
}
